var tipuesearch = {"pages": [{'title': 'First', 'text': '', 'tags': '', 'url': 'First.html'}, {'title': 'W1', 'text': '', 'tags': '', 'url': 'W1.html'}, {'title': 'Cmsimde創建', 'text': 'step1: \n 至 2021 可攜程式系統 \xa0下載 kmol2021_spring_v2.7z 並解壓縮至隨身硬碟 \n step2: \n 進入kmol2021_spring_v2資料夾,data選擇ipc6或ipv4 \n \n step3: \n 將.gitconfig放入小白框修改名稱及信箱 \n \n step4: \n 至 https://github.com/mdecourse/cmstemplate 建立新倉儲 \n \n step5: \n 開啟小黑框 git clone --recurse-submodules\xa0 https://github.com/40823128/cd2021 \n \n step6: \n 開啟網站 Y:\\tmp\\cd2021\\cmsimde>python wsgi.py \n \n step7: \n 開啟新分頁搜尋 https://localhost:9443並進階進入 \n \n step8: \n 登入網站並修改內容 \n \n step9: \n 網站推送測試 \n \n step10: \n 測試成功網站建立完成 \n \n', 'tags': '', 'url': 'Cmsimde創建.html'}, {'title': 'SSH', 'text': '1. 用編輯器進入sh \n 2. 輸入 ssh-keygen -t rsa -b 4096 -C "學號"\xa0 即可取得SSH Key(手打較不容易出錯) \n \n 3.進入.ssh資料夾內 找到路徑裡SSH的鑰匙 \n \n 4.開啟 SCITE將id_rsa.pub 丟入並複製裡面所有的文字 \n \n 5.進 到Github-->seeting-->SSH and GPG keys 按下"New SSH key" \n \n 6.於 Title中填上學號key複製剛剛貼上的key 再按下"Add SSH key" \n \n 7.進入資料夾PuTTY中找到puttygen.exe \n \n 8.進入後按下Load" \n \n 9.至對應的SSH路徑選取id_rsa選取後再按下"save private key" 得到ppk 存到同一個路徑 \n \n 10. \n', 'tags': '', 'url': 'SSH.html'}, {'title': 'W2', 'text': '分組題目:水車 \n \n 1.利用Solidworks繪製水車底座 \n \n 2.利用Solidworks繪製水車上部 \n \n 3.下圖為各零件組合之水車 \n \n', 'tags': '', 'url': 'W2.html'}, {'title': 'W3', 'text': '分組網頁建立以及遇到的問題. \n \n \n 將cms.bat,acp.bat,http-server.py,locallhost.key,locallhost.crt從cmsimde\\up_dir目錄中複製到stage1-ag15>cmsimde倉儲根目錄 \n \n 分組網頁建立成功 \n \n', 'tags': '', 'url': 'W3.html'}, {'title': 'W4', 'text': '', 'tags': '', 'url': 'W4.html'}, {'title': 'w5', 'text': '', 'tags': '', 'url': 'w5.html'}, {'title': 'W6', 'text': '', 'tags': '', 'url': 'W6.html'}, {'title': 'W7', 'text': '第二階段分組專案 \n 題目:砂帶機 \n \n', 'tags': '', 'url': 'W7.html'}, {'title': 'W8', 'text': '繪製個零件圖 \n 1.繪製砂帶機底座 \n \n 2.繪製砂帶機支架 \n \n 3.繪製支架滾輪所需的孔位 \n \n \n 4.繪製砂帶機之滾輪 \n \n \n', 'tags': '', 'url': 'W8.html'}, {'title': 'W9', 'text': '', 'tags': '', 'url': 'W9.html'}, {'title': 'W10', 'text': '', 'tags': '', 'url': 'W10.html'}, {'title': 'W11', 'text': '', 'tags': '', 'url': 'W11.html'}, {'title': 'W12', 'text': '', 'tags': '', 'url': 'W12.html'}, {'title': 'W16', 'text': '建立 CoppeliaSim 4.1.0 MTB robot 場景 \n Onshape繪製機械手臂 \n \n 將Onshpae各零件圖檔儲存成STL檔匯入Coppeliasim \n \n 匯入後將各零件合併較好調整大小及位置。 \n \n 匯入成功後將各零件分開較好裝軸，安裝時先選軸再選物體將兩者合併。 \n \n 中間軸與另外兩軸較不一樣需先抓取兩曲面，再將兩曲面合併取中心裝入軸。 \n \n 裝上方軸 \n \n 裝上吸盤與force sensor，並 將各軸與各物體子母關係合併。 \n \n Onshape繪圖過程 \n \n Coppelaisim場景製作 \n \n', 'tags': '', 'url': 'W16.html'}]};